import React from 'react';
import { HorizontalBar } from 'react-chartjs-2'

/* 5 - Com relação às disciplinas que queria cursar, você conseguiu se matricular em: */

const Gcinco = () => {
    return (
        <HorizontalBar
            data={{
                labels: [
                    'Todas', 'Algumas', 'Nenhuma', 'Não Responderam'
                ],

                datasets: [
                    {
                        data: [708, 788, 48, 23],
                        backgroundColor: "#EEAD2D",
                        hoverBackgroundColor: "#b8831c",
                    },
                ],
            }}
            height={450}
            width={100}
            options={{
                maintainAspectRatio: false,

                layout: {
                    padding: 60,
                },

                legend: {
                    display: false,
                    labels: {
                        fontSize: 15,
                        fontColor: "white",
                        fontFamily: "roboto",
                    },
                    position: "right",
                },

                title: {
                    display: true,
                    padding: 30,
                    text: "Nº de Respondentes/Campi",
                    fontSize: 25,
                    fontColor: "#d3d3d3",
                    fontFamily: "roboto",
                },

                scales: {
                    yAxes:[
                        {
                            display: true,
                            gridLines: {
                                color: "rgba(0, 0, 0, 0)",
                            },

                            barThickness: 23,

                            ticks: {
                                beginAtZero: true,
                                fontSize: 14,
                                fontColor: "#e6e7ea",
                                fontFamily: 'Roboto',
                            },
                        },
                    ],

                    xAxes:[
                        {
                            display: false,
                            ticks: {
                                beginAtZero: true,
                                fontSize: 14,
                                fontColor: "#e6e7ea",
                                fontFamily: 'Roboto',
                            },

                            gridLines: {
                                color: "rgba(0,0,0,0)",
                            },
                        },
                    ],
                },
            }}
        />
    );
};

export default Gcinco;
